import "../../App.css"; // Adjust the path if necessary
import "../../style/WordSearch.css";
import NavigationBar from "../../components/NavigationBar";
import NggolekiTembang from "../../components/isikuisnglegena/NggolekiTembangNglegena";
function IsiKuis1A() {
  return (
    <div>
      {/* Back Arrow */}
      <Link to="/aksaranglegena/kuis1" className="back-arrow">
        <i className="bi bi-arrow-left"></i> {/* Bootstrap Icon */}
      </Link>
      <div>
        {/* navigation bar */}
        <div>
          <NavigationBar />
        </div>
        {/* end of intro section */}

        {/* mode */}
        <div>
          <NggolekiTembang />
        </div>
      </div>
    </div>
  );
}

export default IsiKuis1A;
